import React from 'react';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import { STRING_CONSTANTS } from 'shared/constants/stringConstants';

const COLUMN_HEADERS = STRING_CONSTANTS.TABLE.COLUMN_HEADERS;

export const TableHeaders = () => {

    return (
        <TableHead>
            <TableRow>
                <TableCell>{COLUMN_HEADERS.CHARACTER_NAME}</TableCell>
                <TableCell>{COLUMN_HEADERS.ITEM_NAME}</TableCell>
                <TableCell>{COLUMN_HEADERS.TYPE}</TableCell>
                <TableCell>{COLUMN_HEADERS.SERIES}</TableCell>
                <TableCell>{COLUMN_HEADERS.SERIES_NUMBER}</TableCell>
                <TableCell>{COLUMN_HEADERS.QUANTITY.TOTAL}</TableCell>
                <TableCell>{COLUMN_HEADERS.QUANTITY.NEW_IN_BOX}</TableCell>
                <TableCell>{COLUMN_HEADERS.QUANTITY.OPEN_COMPLETE}</TableCell>
                <TableCell>{COLUMN_HEADERS.QUANTITY.OPEN_INCOMPLETE}</TableCell>
            </TableRow>
        </TableHead>
    );
};
